.',0,1493),(172,'2014-09-20 08:02:07','I took the team out for drinks to celebrate the order manager going live.  I actually think it went very well.  I had a good excuse not to drink because of the referendum.',0,1501),(173,'2014-09-20 08:03:15','Sent Christina a text this morning hoping that her operation was OK.',0,1495),(174,'2014-09-20 08:49:58','I was quite worried about C\'s operation this morning. Low mood. I spent some time reading about lletz in the morning and the YouTube video was less effecting than I thought it would be.',0,1509),(175,'2014-09-20 08:55:06','I arrived late at parsons green station because I\'m an idiot and for some reason didn\'t realise it was on a completely different district line. C looked a little miffed and I was very apologetic.',0,1533),(176,'2014-09-20 08:59:16','The white horse was busier and more rowdy than I expected.  Christina guessed where we were going and had been there before. The first half hour was a little awkward.',0,1533),(177,'2014-09-20 09:00:30','Christina had Diana who is her cousin in Barbados over for the weekend and her brother Andrew. It sounds like they had a good time but she was glad that she didn\'t have to entertain anymore.',0,1533),(178,'2014-09-20 09:04:02','I don\'t know whether it was the large bottle of 5% cider and the pint of sussex bitter but we seemed to really relax and we had a very enjoyable walk back to Putney chatting about Diana\'s sister who moved to the Netherlands and was going out with some OCD',0,1535),(179,'2014-09-20 09:05:49','Apparently C\'s mother likes me because I picked her up at the airport, which I find amusing because that was pleasurable for me and entirely selfish.',0,1535),(180,'2014-09-21 20:42:22','Went for drinks with Liam.  Fire alarm on arrival and a lot of people milling around.  Very cool bar but it felt a little pretentious.',0,1549),(181,'2014-09-21 21:12:13','I woke up at 6am feeling lonely. In a sleeping bag. I then had an inspiration: why not drive over to C\'s and be there when she woke up? This sounded better then. I was in my car by 06:30hrs and the drive over was in high spirits.',0,1556),(182,'2014-09-21 20:46:59','Liam has had a tough month with Sara. They broken off completely. \"Sara is very binary\" wants to spend time or not. I think Liam found it too difficult to compartmentalise. Relationship with Hannah going really well tho. Thinking of moving in together.',0,1549),(183,'2014-09-21 20:47:34','Every dish £6 or less.  Service very definitely optional.  Nice place. :-)',0,1569),(184,'2014-09-21 20:48:29','Old school cocktails.  Pegu Club was pretty good.  Worth visiting again for the restaurant perhaps.',0,1553),(185,'2014-09-21 20:51:19','Cooked braised sausages in cider to take over to Christina\'s house.  First batch of sausages were a write off.  Looking forward to seeing her.',0,1575),(186,'2014-09-21 20:51:35','I\'m not sure why I don\'t have a hangover.',0,1571),(187,'2014-09-21 20:55:10','First time seeing Christina after her LLETZ operation. She seemed fine and didn\'t appear to be in any pain. Op was uncomfortable hearing what was going on but didn\'t feel anything.',0,1577),(188,'2014-09-21 21:00:51','Christina was going stir crazy having spent the last 48days in the house resting so we went for a walk. I don\'t think she is very good spending time at home doing nothing. :-)',0,1579),(189,'2014-09-21 20:57:53','Not bad a town pub.  We spent a pleasant time on a sofa talking about geek squad, Danone fancy dress halloween party and holiday.',0,1579),(190,'2014-09-21 21:10:54','Dinner was pretty good and C seemed to enjoy it. She wanted to go to the cinema but I didn\'t feel like another night out so we watched \"One flew over the cuckoo\'s nest\"',0,1581),(191,'2014-09-21 20:59:51','I spent some time working on getting C\'s photos on her notebook uploaded to the icloud.',0,1581),(192,'2014-09-21 21:02:12','Christina was pretty tired by 11pm and fell asleep a few times on me.  Definitely not going to stay the night so she can get some sleep.  Melancholy drive home.',0,1581),(193,'2014-09-21 21:02:49','I packed an overnight bag but went with the intention not to stay unless C was feeling ok.',0,1577),(194,'2014-09-21 21:14:23','This idea didn\'t sound so smart at 07:00hrs outside Christina\'s house. I\'m going to seem a bit of a sap.  Torn between waking her up and afraid she\'d get up and I\'d miss her.  Sent a couple of text messages at 07:40.  No reply.',0,1556),(195,'2014-09-21 21:15:05','On the plus side - I thoroughly enjoyed the flask of tea, reading the news and fixing a bug on the app.',0,1556),(196,'2014-09-21 21:18:22','Finally called her at 08:10hrs. Sounded v sleepy and came down to open the door.  A little awkward while she made tea but then we sat on the sofa before going back to bed.',0,1556),(197,'2014-09-21 21:25:28','Very enjoyable morning.  Stroking and holding C - I\'m surprised how much I enjoy that.  I could, and did, do it for hours.  Sex off limits due to C\'s recovery but that wasn\'t awkward for either of us at all.',0,1556),(198,'2014-09-21 21:25:54','I think we were both glad that I went over in the end.',0,1556),(199,'2014-09-21 21:38:12','Shopping for summer outfit to use to see Christina tomorrow.',0,1161),(200,'2014-09-26 06:41:52','Checking out the release ahead of meeting Christina. I\'m on call this evening and I am expecting trouble.',0,1195),(201,'2014-09-26 06:49:26','A sunny day and a pleasant walk through Wimbledon common. I felt a little self conscious in shorts. C wore a pretty predominantly blue summer dress with abstract shapes.',0,1197),(202,'2014-09-26 06:52:02','Watched a Shakespeare rehearsal in the gardens. We then got lost in the undergrowth, which was playful. Stopped on a bench in the formal gardens and chatted about films, Hitchcock and horror movies.',0,1732),(203,'2014-09-26 07:01:13','Amusing confusion ordering ice cream at the cafe. We sat on benches and talked about family mostly. Then wandered back sharing attitudes to age (similar), Dorian Grey and books to read on holiday. Mental note to get a copy of the Night Circus.',0,1197),(204,'2015-12-26 07:54:50','Returned from midnight mass at Chieveley church with Mum.',0,1988),(205,'2015-12-26 07:57:00','I woke up quite early and I was in a foul mood because I was still quite tired.  I was also stressed about sacking contractors at work.',0,1988),(206,'2015-12-26 07:58:17','I brightened up during the present opening because M & D were in good form.',0,1988);
